import React from 'react';

const Trade = props => {
  const { trade } = props;

  return (
    <div className='row'>
      <div className='card w-25 text-danger'>
        {trade} wo
      </div>
      <div className='card w-50 text-info'>
        woooo
      </div>
    </div>
  )
}

export default Trade;
